import React from 'react';

const WidgetList = ({widgets=[], createWidget, deleteWidget, updateWidget}) => {
    <div>
        <h1>Widgets</h1>
        <ul>
            {
                widgets.map(widget =>
                    <li>{widget.name}</li>
                )
            }
        </ul>
    </div>
}

export default WidgetList;
